exports=async function(url,bid,cid,options){const{parseContent}=await require("transcode/parse_content");return parseContent(url,"div#content",{clientOptions:{...(options&&options.clientOptions),encoding:"gbk"},preprocess:h=>h.replace(/<p[^>]*>[^<]*飞速中文[^<]+一键直达[^<]*<\/p>/,"").replace(/<p[^>]*>[^<]*最快更新[^<]+<a[^>]*>[^<]+<\/a>\s*<\/p>/,"").replace(/<p[^>]*>[^<]*请访问：[^<]*<a[^>]*>[^<]+<\/a>\s*<\/p>/,"")})};